(1, 54, 'header1', 'HTML', NULL, NULL, 1, NULL, NULL, 'green', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '40', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 54, 'div', 'HTML has been in continuous evolution since it was introduced to the Internet in the early 1990s.Some features were introduced in specifications; others were introduced in software releases. \r\n\r\nIn some respects, implementations and Web developer practices have converged with each other and with specifications and standards, but in other ways, they have diverged.\r\n\r\nHTML4 became a W3C Recommendation in 1997. While it continues to serve as a rough guide to many of the core features of HTML, it does not provide enough information to build implementations that interoperate with each other and, more importantly, with Web content. The same goes for XHTML1, which defines an XML serialization for HTML4, and DOM Level 2 HTML, which defines JavaScript APIs for both HTML and XHTML. HTML replaces these documents. [DOM2HTML] [HTML4] [XHTML1]\r\n\r\nThe HTML specification reflects an effort, started in 2004, to study contemporary HTML implementations and Web content. The specification:\r\n\r\nDefines a single language called HTML which can be written in HTML syntax and in XML syntax.\r\n\r\nDefines detailed processing models to foster interoperable implementations.\r\n\r\nImproves markup for documents.\r\n\r\nIntroduces markup and APIs for emerging idioms, such as Web applications.', NULL, NULL, 1, NULL, NULL, 'blue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 54, 'header1', 'New Elements', NULL, NULL, 1, NULL, NULL, 'blue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 54, 'div', 'The following elements have been introduced for better structure:\r\n\r\nsection represents a generic document or application section. It should be used together with the h1, h2, h3, h4, h5, and h6 elements to indicate the document structure.\r\n\r\narticle represents an independent piece of content of a document, such as a blog entry or newspaper article.\r\n\r\nmain represents the main content of the body of a document or application.\r\n\r\naside represents a piece of content that is only slightly related to the rest of the page.\r\n\r\nheader represents a group of introductory or navigational aids.\r\n\r\nfooter represents a footer for a section and can contain information about the author, copyright information, etc.\r\n', NULL, NULL, 1, NULL, NULL, 'blue', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);

