(39, 9, 'Basics in C', 2, 1, '--------------------------------------------------------------------------------\r\n* Overview                            --------------------------------- 1   day\r\n* Program basics                      --------------------------------- 1   day\r\n* C Environment Setup                 --------------------------------- 2   days  \r\n* C Program Structure                 --------------------------------- 2   days\r\n* C Basic Syntax                      --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------'),
(41, 9, 'Complex data types', 4, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- C Arrays                            --------------------------------- 2   days\r\n- C Pointers                          --------------------------------- 2   days\r\n- C Strings                           --------------------------------- 2   days\r\n- C Structures                        --------------------------------- 2   days\r\n- C Unions                            --------------------------------- 2   days\r\n- C Bit Fields                        --------------------------------- 2   days\r\n- C Typedef                           --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------'),
(42, 9, 'Constructs', 5, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day \r\n- C Operators                         --------------------------------- 2   days\r\n- C Decision Making                   --------------------------------- 2   days\r\n- C Loops                             --------------------------------- 2   days\r\n- C Functions                         --------------------------------- 2   days\r\n- C Scope Rules                       --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------'),
(43, 9, 'Data handling', 6, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- C Input & Output                    --------------------------------- 2   days\r\n- C File I/O                          --------------------------------- 2   days\r\n- C Preprocessors                     --------------------------------- 2   days\r\n- C Header Files                      --------------------------------- 2   days\r\n- C Type Casting                      --------------------------------- 2   days\r\n- C Error Handling                    --------------------------------- 2   days\r\n- C Recursion                         --------------------------------- 2   days\r\n- C Variable Arguments                --------------------------------- 2   days\r\n- C Memory Management                 --------------------------------- 2   days\r\n- C Command Line Arguments            --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------'),
(44, 9, 'Data structures', 7, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- linked list(single/double)          --------------------------------- 5   days\r\n- trees                               --------------------------------- 5   days\r\n- stack                               --------------------------------- 5   days\r\n- fifo/queue                          --------------------------------- 5   days\r\n\r\n--------------------------------------------------------------------------------'),
(45, 9, 'Development tools', 8, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- compilers                           --------------------------------- 5   days\r\n- linkers                             --------------------------------- 5   days\r\n- loaders                             --------------------------------- 5   days\r\n- make                                --------------------------------- 5   days\r\n\r\n--------------------------------------------------------------------------------'),
(46, 9, 'Advanced', 9, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- ELF format                          --------------------------------- 5   days\r\n- executable anatomy in memory        --------------------------------- 5   days\r\n- OOPS - Why C++                      --------------------------------- 10  days\r\n- FOSS                                --------------------------------- 5   days\r\n- Why FOSS                            --------------------------------- 5   days\r\n- FOSS licences                       --------------------------------- 5   days\r\n- Open source projects in C           --------------------------------- 2   days\r\n-  +-- Linux                          --------------------------------- 1   day\r\n-  +-- u-boot                         --------------------------------- 1   day\r\n- bug tracking (bugzilla)             --------------------------------- 2   days \r\n- versioning   (git/github)           --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------'),
(47, 9, 'Contribute', 10, 1, '--------------------------------------------------------------------------------\r\n- About RAPID                         \r\n- Contribute back to RAPID \r\n- Contribute back to community\r\n- Practical use \r\n- Linux Device drivers character\r\n- Linux Device drivers block\r\n- Linux Device drivers network\r\n================================================================================'),
(51, 9, 'Data types', 3, 1, '--------------------------------------------------------------------------------\r\n- Overview                            --------------------------------- 1   day\r\n- C Data Types                        --------------------------------- 2   days\r\n- C Variables                         --------------------------------- 2   days\r\n- C Constants                         --------------------------------- 2   days\r\n- C Storage Classes                   --------------------------------- 2   days\r\n\r\n--------------------------------------------------------------------------------');

