(9, 39, 'Overview', 1, 1, ' C is a general-purpose, high-level language that was originally developed by Dennis M. Ritchie to develop the UNIX operating system at Bell Labs. C was originally first implemented on the DEC PDP-11 computer in 1972.  '),
(10, 39, 'Program basics', 2, 1, 'C basic program with output and explanation\r\nSteps to write C programs and get the output\r\nCreation, Compilation and Execution of a C program\r\nHow to install C compiler and IDE\r\nBasic structure of a C program'),
(11, 39, 'Environment Setup', 3, 1, ' ou really do not need to set up your own environment to start learning C programming language. Reason is very simple, we already have set up C Programming environment online, so that you can compile and execute all the available examples online at the same time when you are doing your theory work. This gives you confidence in what you are reading and to check the result with different options. Feel free to modify any example and execute it online.  '),
(12, 39, 'Program Structure', 4, 1, ' Structure is the collection of variables of different types under a single name for better handling. For example: You want to store the information about person about his/her name, citizenship number and salary. You can create these information separately but, better approach will be collection of these information under single name because all these information are related to person.  '),
(17, 34, 'Basic Configuration', 1, 1, 'Default Configuration\r\n\r\nWhen you boot up your Cisco router for the first time, you notice some basic configuration has already been performed. Use the show running-config command to view the initial configuration, as shown in the following example.\r\n\r\nRouter# show running-config\r\nBuilding configuration...\r\nCurrent configuration : 723 bytes\r\n!\r\nversion 12.4\r\nno service pad\r\nservice timestamps debug datetime msec\r\nservice timestamps log datetime msec\r\nno service password-encryption\r\n!\r\nhostname Router\r\n!\r\nboot-start-marker\r\nboot-end-marker\r\n!\r\nlogging message-counter syslog\r\n!\r\nno aaa new-model\r\n!\r\nno ipv6 cef\r\nip source-route\r\nip cef\r\n!\r\n!\r\n!\r\n!\r\nmultilink bundle-name authenticated\r\n!\r\n!\r\narchive\r\nlog config\r\nhidekeys\r\n!\r\n!\r\n!\r\n!\r\n!\r\ninterface GigabitEthernet0/0\r\nno ip address\r\nshutdown\r\nduplex auto\r\nspeed auto\r\n!\r\ninterface GigabitEthernet0/1\r\nno ip address\r\nshutdown\r\nduplex auto\r\nspeed auto\r\n!\r\ninterface GigabitEthernet0/2\r\nno ip address\r\nshutdown\r\nduplex auto\r\nspeed auto\r\n!\r\nip forward-protocol nd\r\n!\r\nno ip http server\r\n!\r\n!\r\n!\r\n!\r\n!\r\ncontrol-plane\r\n!\r\n!\r\nline con 0\r\nline aux 0\r\nline vty 0 3\r\nlogin\r\n!\r\nexception data-corruption buffer truncate\r\nscheduler allocate 20000 1000\r\nend'),
(48, 51, 'Overview', 1, 1, 'In the C programming language, data types refer to an extensive system used for declaring variables or functions of different types. The type of a variable determines how much space it occupies in storage and how the bit pattern stored is interpreted.\r\n'),
(49, 51, 'C Data Types', 1, 1, '1	Basic Types:\r\nThey are arithmetic types and consists of the two types: (a) integer types and (b) floating-point types.\r\n\r\n2	Enumerated types:\r\nThey are again arithmetic types and they are used to define variables that can only be assigned certain discrete integer values throughout the program.\r\n\r\n3	The type void:\r\nThe type specifier void indicates that no value is available.\r\n\r\n4	Derived types:\r\nThey include (a) Pointer types, (b) Array types, (c) Structure types, (d) Union types and (e) Function types.\r\n\r\n'),
(50, 51, 'C Storage Classes', 1, 1, '\r\nA storage class defines the scope (visibility) and life time of variables and/or functions within a C Program.\r\n\r\nThere are following storage classes which can be used in a C Program\r\n\r\nauto\r\n\r\nregister\r\n\r\nstatic\r\n\r\nextern\r\n\r\nauto - Storage\r\n'),
(51, 51, 'C Constants', 1, 1, '\r\nThe constants refer to fixed values that the program may not alter during its execution. These fixed values are also called literals.\r\n\r\nConstants can be of any of the basic data types like an integer constant, a floating constant, a character constant, or a string literal. There are also enumeration constants as well.\r\n\r\nThe constants are treated just like regular variables except that their values cannot be modified after their definition.\r\n'),
